ht.columns.drawCell:
__ht__function(g, text, rect, option) {
            var row = option.row;
            var value = row.states;
            var data = new ht.Data();
            data.a('stateNum', value);
            ht.Default.drawStretchImage(g, ht.Default.getImage('symbols/hjx/alert.json'), 'uniform', rect.x-3, rect.y+5, rect.width-10, rect.height-10, data)
        }
